# Function to calculate distance
def distance(x00, y00,x01,y01,x10, y10,x11,y11):
    # Calculating distance
    return math.sqrt(math.pow(x00 - x10, 2) +
                     math.pow(y00 - y10, 2)+
    math.pow(x01 - x11, 2)+
                     math.pow(y01 - y11, 2)



                     * 1.0)


import copy
def get_blocks(data):
    # data.sort()
    pages = len(data)
    pagesData = {}

    for page in range(pages):
        pageData = data[page]
        test=copy.deepcopy(pageData)
        # pageData.sort(key=lambda x: math.sqrt((math.pow(x[3]-x[0],2))))
        # pageData.sort(key=lambda x: math.sqrt((math.pow(x[3]-x[0],2))))
        # pageData.sort(key=lambda x: math.sqrt(((x[2] - x[0])**2) + ((x[3] - x[1])**2)), reverse=True)
        pageData.sort(key=lambda x:x[3])
        for ith in range(len(pageData)):
            rows = pageData[ith]
            if ith ==0:
                pagesData[page]=[]
                pagesData[page].append(rows[-4])
                lastVal = rows
            else:
                dist = distance(lastVal[0],lastVal[1], lastVal[2], lastVal[3], rows[0], rows[1], rows[2], rows[3])
                if dist <75:
                    pagesData[page][-1]  = pagesData[page][-1]+ " "+rows[-4]
                else:
                    pagesData[page].append(rows[-4])
                lastVal = rows
    return pagesData

